pragma solidity ^0.8.1;

contract Administrable {
    address public admin;
    address public pendingAdmin;
    event LogSetAdmin(address admin);
    event LogTransferAdmin(address oldadmin, address newadmin);
    event LogAcceptAdmin(address admin);

    function setAdmin(address admin_) internal {
        admin = admin_;
        emit LogSetAdmin(admin_);
    }

    function transferAdmin(address newAdmin) external onlyAdmin {
        address oldAdmin = pendingAdmin;
        pendingAdmin = newAdmin;
        emit LogTransferAdmin(oldAdmin, newAdmin);
    }

    function acceptAdmin() external {
        require(msg.sender == pendingAdmin);
        admin = pendingAdmin;
        pendingAdmin = address(0);
        emit LogAcceptAdmin(admin);
    }

    modifier onlyAdmin() {
        require(msg.sender == admin);
        _;
    }
}

interface IAnycallV6Proxy {
    function anyCall(
        address _to,
        bytes calldata _data,
        address _fallback,
        uint256 _toChainID,
        uint256 _flags
    ) external payable;

    function executor() external view returns (address);
}

interface IExecutor {
    function context() external returns (address from, uint256 fromChainID, uint256 nonce);
}

abstract contract AnyCallApp is Administrable {
    uint256 public flag; // 0: pay on dest chain, 2: pay on source chain
    address public anyCallProxy;

    mapping(uint256 => address) internal peer;

    event SetPeers(uint256[] chainIDs, address[] peers);
    event SetAnyCallProxy(address proxy);

    modifier onlyExecutor() {
        require(msg.sender == IAnycallV6Proxy(anyCallProxy).executor());
        _;
    }

    bool initiated_anyCall = false;

    function initiateAnyCallApp (address anyCallProxy_, uint256 flag_) public {
        require(!initiated_anyCall);
        initiated_anyCall = true;
        anyCallProxy = anyCallProxy_;
        flag = flag_;
    }

    function setPeers(uint256[] memory chainIDs, address[] memory  peers) public onlyAdmin {
        for (uint i = 0; i < chainIDs.length; i++) {
            peer[chainIDs[i]] = peers[i];
            emit SetPeers(chainIDs, peers);
        }
    }

    function getPeer(uint256 foreignChainID) external view returns (address) {
        return peer[foreignChainID];
    }

    function setAnyCallProxy(address proxy) public onlyAdmin {
        anyCallProxy = proxy;
        emit SetAnyCallProxy(proxy);
    }

    function _anyExecute(uint256 fromChainID, bytes calldata data) internal virtual returns (bool success, bytes memory result);

    function _anyCall(address _to, bytes memory _data, address _fallback, uint256 _toChainID) internal {
        if (flag == 2) {
            IAnycallV6Proxy(anyCallProxy).anyCall{value: msg.value}(_to, _data, _fallback, _toChainID, flag);
        } else {
            IAnycallV6Proxy(anyCallProxy).anyCall(_to, _data, _fallback, _toChainID, flag);
        }
    }

    function anyExecute(bytes calldata data) external onlyExecutor returns (bool success, bytes memory result) {
        (address callFrom, uint256 fromChainID,) = IExecutor(IAnycallV6Proxy(anyCallProxy).executor()).context();
        require(peer[fromChainID] == callFrom, "call not allowed");
        _anyExecute(fromChainID, data);
    }

}

contracts/MultichainVerseExplore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./AnyCallV6App.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";

contract MultichainVerseExplore is ERC721EnumerableUpgradeable, AnyCallApp {
    function initialize(address anyCallProxy, address admin) public initializer {
        __ERC721_init_unchained("MultichainVerse Explore", "MVE");
        initiateAnyCallApp(anyCallProxy, 2);
        setAdmin(admin);
        MaxTokenIdId = 1000000;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override
        returns (string memory)
    {
        return "ipfs://QmRsQzm69ipBMeEYBAbXD2tSTiKb1Rh8CDAnriRM8zEXgX";
    }

    mapping(uint256 => uint256) public generationOf;

    uint256 public nextTokenId;
    address public minter;

    uint256 public MaxTokenIdId;

    uint256 public swapoutSeq = 0;

    event Mint(address to, uint256 tokenId);
    event SetMinter(address minter);
    event Outbound(uint256 tokenId, address receiver, uint256 toChainID);
    event Inbound(uint256 tokenId, address receiver, uint256 fromChainID);

    function setMinter(address minter_) public onlyAdmin {
        minter = minter_;
        emit SetMinter(minter);
    }

    function mint(address to) public {
        require(msg.sender == minter);
        require(nextTokenId < MaxTokenIdId);
        uint256 tokenId = block.chainid * MaxTokenIdId + nextTokenId;
        _mint(to, tokenId);
        generationOf[tokenId] = 1;
        nextTokenId += 1;
        emit Mint(to, tokenId);
    }

    function Swapout_no_fallback(
        uint256 tokenId,
        address receiver,
        uint256 destChainID
    ) external payable returns (uint256) {
        bytes memory extraMsg = abi.encode(generationOf[tokenId]);
        _burn(tokenId);
        swapoutSeq++;
        bytes memory data = abi.encode(
            tokenId,
            msg.sender,
            receiver,
            swapoutSeq,
            extraMsg
        );
        _anyCall(peer[destChainID], data, address(0), destChainID);
        emit Outbound(tokenId, receiver, destChainID);
        return swapoutSeq;
    }

    function _anyExecute(uint256 fromChainID, bytes calldata data)
        internal
        override
        returns (bool success, bytes memory result)
    {
        (uint256 tokenId, , address receiver, , bytes memory extraMsg) = abi
            .decode(data, (uint256, address, address, uint256, bytes));
        uint256 generation = abi.decode(extraMsg, (uint256));
        _mint(receiver, tokenId);
        generationOf[tokenId] = generation + 1;
        emit Inbound(tokenId, receiver, fromChainID);
    }
}

